{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/manishasharma31/google-capstone-project-fitbit-fitness-tracker?scriptVersionId=97223911\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown","outputs":[],"execution_count":0},{"cell_type":"markdown","id":"96f0721e","metadata":{"papermill":{"duration":0.075624,"end_time":"2022-06-01T16:11:13.942826","exception":false,"start_time":"2022-06-01T16:11:13.867202","status":"completed"},"tags":[]},"source":["## Introduction : we are using 6 phases for data analysis which are Ask, Prepare,Process, Analyze,Share and Act.\n","\n","\n"]},{"cell_type":"markdown","id":"697d1d8b","metadata":{"papermill":{"duration":0.072486,"end_time":"2022-06-01T16:11:14.089162","exception":false,"start_time":"2022-06-01T16:11:14.016676","status":"completed"},"tags":[]},"source":["\n"," # ASK \n","\n","## About the Bellabeat Company \n","\n","Urška Sršen and Sando Mur founded Bellabeat, a high-tech company that manufactures health-focused smart products. Sršen used her background as an artist to develop beautifully designed technology that informs and inspires women around the world. Collecting data on activity, sleep, stress, and reproductive health has allowed Bellabeat to empower women with knowledge about their own health and habits. Since it was founded in 2013, Bellabeat has grown rapidly and quickly positioned itself as a tech-driven wellness company for women.\n","\n","## Some products company owns.\n","\n","* Bellabeat app: It provides users with health data related to their activity, sleep, stress, menstrual cycle, and mindfulness habits.\n","\n","* Leaf: It's a tracker, can be worn as a bracelet, necklace, or clip. It connects to the Bellabeat app to track activity, sleep, and stress.\n","\n","* Time: This wellness watch combines the timeless look of a classic timepiece with smart technology to track user activity, sleep, and stress. \n","\n","* Spring: This is a water bottle that tracks daily water intake using smart technology to ensure that you are appropriately hydrated throughout the day.\n","\n","\n","## Key stakeholdees\n","\n","* Urška Sršen: Bellabeat’s cofounder and Chief Creative Officer.\n","\n","* Sando Mur: Mathematician and Bellabeat’s cofounder; key member of the Bellabeat executive team.\n","\n","\n","## Business task \n","\n","* What are some trends in smart device usage?\n","\n","* How could these trends apply to Bellabeat customers?\n","\n","* How could these trends help influence Bellabeat marketing strategy?\n","\n","\n","# PREPARE\n"]},{"cell_type":"code","execution_count":1,"id":"afe2f05b","metadata":{"execution":{"iopub.execute_input":"2022-06-01T16:11:14.241154Z","iopub.status.busy":"2022-06-01T16:11:14.237932Z","iopub.status.idle":"2022-06-01T16:15:14.899785Z","shell.execute_reply":"2022-06-01T16:15:14.899112Z"},"papermill":{"duration":240.739225,"end_time":"2022-06-01T16:15:14.899961","exception":false,"start_time":"2022-06-01T16:11:14.160736","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["Installing package into ‘/usr/local/lib/R/site-library’\n","(as ‘lib’ is unspecified)\n","\n","Warning message:\n","“unable to access index for repository http://cran.rstudio.com/src/contrib:\n","  cannot open URL 'http://cran.rstudio.com/src/contrib/PACKAGES'”\n","Warning message:\n","“package ‘tidyverse’ is not available for this version of R\n","\n","A version of this package for your version of R might be available elsewhere,\n","see the ideas at\n","https://cran.r-project.org/doc/manuals/r-patched/R-admin.html#Installing-packages”\n","Installing package into ‘/usr/local/lib/R/site-library’\n","(as ‘lib’ is unspecified)\n","\n","Warning message:\n","“unable to access index for repository http://cran.rstudio.com/src/contrib:\n","  cannot open URL 'http://cran.rstudio.com/src/contrib/PACKAGES'”\n","Wa